tle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"69db117c-20a1-4910-87b6-003f0d754215"},{"version":"CommandV1","origId":2891587701121675,"guid":"9a824a4b-11b5-45ba-bd62-e625ea3dba9b","subtype":"command","commandType":"auto","position":0.75,"command":"%md\n## Objective\n* The datasets contains transactions made by credit cards in September 2013 by european cardholders. This dataset presents transactions that occurred in two days, where we have 492 frauds out of 284,807 transactions. The dataset is highly unbalanced, the positive class (frauds) account for 0.172% of all transactions.\n\n* It contains only numerical input variables which are the result of a PCA transformation. Unfortunately, due to confidentiality issues, we cannot provide the original features and more background information about the data. Features V1, V2, ... V28 are the principal components obtained with PCA, the only features which have not been transformed with PCA are 'Time' and 'Amount'. Feature 'Time' contains the seconds elapsed between each transaction and the first transaction in the dataset. The feature 'Amount' is the transaction Amount, this feature can be used for example-dependant cost-senstive learning. Feature 'Class' is the response variable and it takes value 1 in case of fraud and 0 otherwise.\n\n* Use Logistic Regression\n  * Train on a portion of the dataset\n  * Test the trained model against the remainder of the dataset\n    * Accuracy can be determined because the dataset is labeled (i.e., this uses supervised learning)\n\n* Result:\n  * In this kind of problem, instead of acheving an oveall accuracy, we would like to know how many fraud transactions were correctly identified and how many were missed.\n  * Using Logistic Regression for prediction of fraud trannsaction, we were able to acheve a 63% accuracy in identifying the number of frauds.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,
